SELECT COUNT(*) as agg_0, COUNT(*) as agg_1 FROM "supplier" LEFT OUTER JOIN "lineorder" ON "supplier"."s_suppkey" = "lineorder"."lo_suppkey" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey"  WHERE "supplier"."s_nation" NOT LIKE '%IRA%Q%' AND "part"."p_catery" NOT LIKE '%MF%GR#35%'